# -*- coding:utf-8 -*-

class Solution:
    def minNumberInRotateArray(self, rotateArray):
        if len(rotateArray) == 0:
            return 0
        if len(rotateArray) == 1:
            return rotateArray[0]
        if len(rotateArray) == 2:
            return min(rotateArray)
        count = len(rotateArray)
        centerIndex = count//2
        center = rotateArray[centerIndex]
        start = rotateArray[0]
        end = rotateArray[count-1]
        if center<start:
            return self.minNumberInRotateArray(rotateArray[0:centerIndex+1])
        elif center>end:
            return self.minNumberInRotateArray(rotateArray[centerIndex+1:])
    def minNumberInRotateArray1(self, rotateArray):
        while(True):
            if len(rotateArray) == 0:
                return 0
            if len(rotateArray) == 1:
                return rotateArray[0]
            if len(rotateArray) == 2:
                return min(rotateArray)
            count = len(rotateArray)
            centerIndex = count//2
            center = rotateArray[centerIndex]
            start = rotateArray[0]
            end = rotateArray[count-1]
            if center<=start:
                rotateArray = rotateArray[0:centerIndex+1]
            elif center>=end:
                rotateArray = rotateArray[centerIndex+1:]
    def minNumberInRotateArray2(self, rotateArray):
        if len(rotateArray) == 0:
            return 0
        if len(rotateArray) == 1:
            return rotateArray[0]
        if len(rotateArray) == 2:
            return min(rotateArray)
        count = len(rotateArray)
        centerIndex = count//2
        center = rotateArray[centerIndex]
        target = rotateArray[-1]
        if center>target:
            return self.minNumberInRotateArray2(rotateArray[centerIndex+1:])
        elif center<target:
            return self.minNumberInRotateArray2(rotateArray[0:centerIndex+1])
        elif center==target:
            return self.minNumberInRotateArray2[rotateArray[0:len(rotateArray)-1]]
